const users=async()=>{return await(await fetch("http://localhost:3002/users")).json()},createList=async()=>{var t=await users();for(let e=0;e<t.length;e++){var n,a=document.createElement("ul");for(n in document.querySelector(".list-wrap").appendChild(a),t[e]){var r=document.createElement("li");if("object"==typeof t[e][n]&&null!==t[e][n]){r.textContent=n+":";var l,c=document.createElement("ul");for(l in r.appendChild(c),t[e][n]){var o=document.createElement("li");o.textContent=l+": "+t[e][n][l],c.appendChild(o)}}else r.textContent=n+": "+t[e][n];a.appendChild(r)}}};document.querySelector("button").addEventListener("click",()=>{createList()});